import React from 'react';

const AppReducer = (state, action) => {

switch (action.type){
    
    case  'Add_Transaction':
        return state;
        break
    case  'Delete_Transaction':
        return state;
        break
    default: 
        return state;
        break
}

};
export default AppReducer;
